import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div>
      <div className="navbar">GitHub User Search</div>
      <div className="search">
        <Form onSubmit={this.handleSubmit}>
          <Form.Group>
            <Form.Input
              placeholder="Name"
              name="name"
              value={name}
              onChange={this.handleChange}
            />
            <Form.Input
              placeholder="Email"
              name="email"
              value={email}
              onChange={this.handleChange}
            />
            <Form.Button content="Submit" />
          </Form.Group>
        </Form>
      </div>
    </div>
  );
}

export default App;
